import React from 'react';
import { Link } from 'react-router-dom';

function NavBar(props) {
  return (
    <nav className="navbar">
      <div className="project-name">
        <Link to="/">
          <img width="48" height="48" src="https://img.icons8.com/doodle/48/book-shelf--v1.png" alt="book-shelf--v1"/> Next Chapter
        </Link>
      </div>
      <ul className="nav-links">
        <li><Link to="/upload">Upload</Link></li>
        <li><Link to="/quizquestion1">Quiz</Link></li>
        <li><Link to="/about-us">About Us</Link></li>
        <li><Link to="/my-shelf">My Shelf</Link></li>
      </ul>
      <div className="hamburger-menu" style="block">
        <a><Link to="/upload">Upload</Link></a>
        <a><Link to="/quizquestion1">Quiz</Link></a>
        <a><Link to="/about-us">About Us</Link></a>
        <a><Link to="/my-shelf">My Shelf</Link></a>
      </div>
      <div className="hamburger" onClick={mobileMenu}> 
        <span className="bar"></span>
        <span className="bar"></span> 
        <span className="bar"></span>  
      </div> 
    </nav>
  );
}

function mobileMenu(event) {
    return(
      <div className="hamburger-menu" style="block">
        <a><Link to="/upload">Upload</Link></a>
        <a><Link to="/quizquestion1">Quiz</Link></a>
        <a><Link to="/about-us">About Us</Link></a>
        <a><Link to="/my-shelf">My Shelf</Link></a>
      </div>
    );
}

export default NavBar;
